INSERT INTO `wp_posts` VALUES (2,1,'2018-08-05 15:44:24','2018-08-05 15:44:24','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-08-05 16:29:12','2018-08-05 16:29:12','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(3,1,'2018-08-05 15:44:24','2018-08-05 15:44:24','<h2>Who we are</h2><p>Our website address is: http://localhost/wordpress.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','trash','closed','open','','privacy-policy__trashed','','','2018-08-05 16:28:59','2018-08-05 16:28:59','',0,'http://localhost/wordpress/?page_id=3',0,'page','',0),(6,1,'2018-08-05 16:28:59','2018-08-05 16:28:59','<h2>Who we are</h2><p>Our website address is: http://localhost/wordpress.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2018-08-05 16:28:59','2018-08-05 16:28:59','',3,'http://localhost/wordpress/3-revision-v1/',0,'revision','',0),(7,1,'2018-08-05 16:29:12','2018-08-05 16:29:12','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2018-08-05 16:29:12','2018-08-05 16:29:12','',2,'http://localhost/wordpress/2-revision-v1/',0,'revision','',0),(8,1,'2018-08-05 16:34:01','2018-08-05 16:34:01','','Contact','','trash','closed','closed','','contact__trashed','','','2018-08-05 18:20:59','2018-08-05 18:20:59','',0,'http://localhost/wordpress/?page_id=8',0,'page','',0),(9,1,'2018-08-05 16:34:01','2018-08-05 16:34:01','','Contact','','inherit','closed','closed','','8-revision-v1','','','2018-08-05 16:34:01','2018-08-05 16:34:01','',8,'http://localhost/wordpress/8-revision-v1/',0,'revision','',0),(10,1,'2018-08-05 16:34:20','2018-08-05 16:34:20','','Portfolio','','trash','closed','closed','','portfolio__trashed','','','2018-08-05 20:54:49','2018-08-05 20:54:49','',0,'http://localhost/wordpress/?page_id=10',0,'page','',0),(11,1,'2018-08-05 16:34:20','2018-08-05 16:34:20','','Portfolio','','inherit','closed','closed','','10-revision-v1','','','2018-08-05 16:34:20','2018-08-05 16:34:20','',10,'http://localhost/wordpress/10-revision-v1/',0,'revision','',0),(12,1,'2018-08-05 16:34:33','2018-08-05 16:34:33','','Resume','','trash','closed','closed','','resume__trashed','','','2018-08-05 16:36:34','2018-08-05 16:36:34','',0,'http://localhost/wordpress/?page_id=12',0,'page','',0),(13,1,'2018-08-05 16:34:33','2018-08-05 16:34:33','','Resume','','inherit','closed','closed','','12-revision-v1','','','2018-08-05 16:34:33','2018-08-05 16:34:33','',12,'http://localhost/wordpress/12-revision-v1/',0,'revision','',0),(14,1,'2018-08-05 16:38:12','2018-08-05 16:38:12','{\n    \"blogname\": {\n        \"value\": \"\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-05 16:38:12\"\n    },\n    \"blogdescription\": {\n        \"value\": \"\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-05 16:38:12\"\n    },\n    \"portfolioo::header_textcolor\": {\n        \"value\": \"#000000\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-05 16:38:12\"\n    }\n}','','','trash','closed','closed','','c56ef06b-f36e-4210-b886-e6d574c10f72','','','2018-08-05 16:38:12','2018-08-05 16:38:12','',0,'http://localhost/wordpress/c56ef06b-f36e-4210-b886-e6d574c10f72/',0,'customize_changeset','',0),(15,1,'2018-08-05 16:39:05','2018-08-05 16:39:05','{\n    \"show_on_front\": {\n        \"value\": \"page\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-05 16:38:49\"\n    }\n}','','','trash','closed','closed','','900fd97c-0733-4073-a0a6-c5e82fa312ba','','','2018-08-05 16:39:05','2018-08-05 16:39:05','',0,'http://localhost/wordpress/?p=15',0,'customize_changeset','',0),(16,1,'2018-08-05 16:39:21','2018-08-05 16:39:21','<h1>Bilal Mahmood</h1>		\n			<h4>Data Scientist</h4>		\n											<a href=\"https://www.linkedin.com/in/bilal-mahmood-da/\" data-elementor-open-lightbox=\"\">\n							<img width=\"847\" height=\"847\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/personal-picture-gray.jpg\" alt=\"\" />								</a>\n			<h3>Experience</h3>		\n			<h5>2017</h5>		\n			<h3><a href=\"https://pk.ibex.co/\">IBEX Global</a></h3>		\n		<p>Built a multiclass supervised machine learning model in Python, for AT&amp;T and Frontier campaigns, that automated the process of detecting customer issues from text data. The model tagged ~10000 English comments with more than 75% accuracy within few minutes</p><p>Used Python’s NLTK package along with Stanford’s Core NLP to identify customer sentiments for several clients and tracked them weekly to assist operations make data-driven decisions</p><p>Recommended new customer satisfaction and average handling time for new agents to help them become more proficient by doing exploratory data analysis using Tableau</p>		\n			<h5>2016</h5>		\n			<h3><a href=\"http://www.northstar-its.com/\">Northstar IT</a></h3>		\n		<p>Implemented trading strategy in Python that allowed optimization of key parameters by evaluating the results over past ten years of time series data for 30 popular currency pairs</p><p>Deployed and managed Python scraper on Amazon EC2 instance which collected data from ~8000 charging points spread across the US</p>		\n			<h3>About Me</h3>		\n		<p>An individual who finds joy in solving problems using code and mathematics. Who finds joy in learning new things, technology and playing music. Who uses cycling to keep healthy and pets a dog to keep close to nature</p>		\n			<h3>Education</h3>		\n			<h5>2018</h5>		\n			<h3><a href=\"https://www.coursera.org/account/accomplishments/specialization/4YNE235FQLYH\">Deep Learning Specialization</a></h3>		\n		<p>Learned to participate in the development of cutting-edge AI technology, and understood the capability, the challenges, and the consequences of the rise of deep learning. Through five interconnected courses, I learned to develop a profound knowledge of the hottest AI algorithms, mastering deep learning from its foundations (neural networks) to its industry applications (Computer Vision, Natural Language Processing, Speech Recognition, etc.)</p>		\n			<h5>2016</h5>		\n			<h3><a href=\"https://confirm.udacity.com/KKHSKDJM\">Data Analyst Nanodegree</a></h3>		\n		<p>Completed several modules as part of the data analyst nanodegree program ranging from exploring New York subway data to doing exploratory data analysis on the wine dataset in R to building a machine learning model in Python that identified scoundrels of the Enron scandal. In addition, focused on data visualization by deploying a baseball visual, showing relationship between handedness and performance, built using D3, on Github and ran A/B tests on Udacity’s internal data to improve student experience</p>		\n			<h5>2015</h5>		\n			<h3><a href=\"https://lums.edu.pk/\">BS Electrical Engineering </a></h3>		\n		<p>Learned to apply knowledge of mathematics, science, engineering fundamentals and an engineering specialization (Electrical Engineering) to the solution of complex engineering problems</p>		\n			<h3>Skills</h3>		\n				Python\n				Machine learning/Deep Learning\n				SQL\n				Visualization\n				Web development\n			<h3>Contact</h3>		\n					<ul>\n							<li >\n										bilal.mahmood.engineer@gmail.com\n									</li>\n								<li >\n										(92) 3034862808\n									</li>\n						</ul>','Resume','','publish','closed','closed','','resume','','','2018-08-05 20:52:26','2018-08-05 20:52:26','',0,'http://localhost/wordpress/?page_id=16',0,'page','',0),(17,1,'2018-08-05 16:39:21','2018-08-05 16:39:21','','Resume','','inherit','closed','closed','','16-revision-v1','','','2018-08-05 16:39:21','2018-08-05 16:39:21','',16,'http://localhost/wordpress/16-revision-v1/',0,'revision','',0),(18,1,'2018-08-05 16:40:15','2018-08-05 16:40:15','{\n    \"page_on_front\": {\n        \"value\": \"16\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-05 16:40:15\"\n    }\n}','','','trash','closed','closed','','eed1cac2-b81f-4d85-bc81-9eb11ff8af1e','','','2018-08-05 16:40:15','2018-08-05 16:40:15','',0,'http://localhost/wordpress/eed1c