/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"277\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_dashboard.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"279\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_account.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"278\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_waiter.png\" alt=\"\" /></a></figure>		\n			<h6>Simple Waiter caller App that allows restaurant owners to use technology to know when their customers need a waiter. The restaurant owner places a small URL on each table which a customer makes a request on to call a waiter and request is logged on the dashboard that is visible to the restaurant owner</h6>		\n			<h2><h3 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Type Here...\" style=\"color: rgb(12, 12, 12); text-align: center;\">Highlight Problems Around You</h3></h2>		\n			<figure><a href=\"https://github.com/bilalmahmood1/Capture-Crime\"><img width=\"525\" height=\"250\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/crimemap-1.png\" alt=\"\" /></a></figure>		\n			<h2>The goal of this website is to allow citizens to register their concerns and the relevant government bodies to take action. It is high time that the governments, especially of developing nations, rely on data to get its priorities straight and a platform for the public to raise their local problems</h2>','Portfolio','','publish','closed','closed','','portfolio','','','2018-08-06 14:24:58','2018-08-06 14:24:58','',0,'http://localhost/wordpress/?page_id=63',0,'page','',0),(64,1,'2018-08-05 20:59:46','2018-08-05 20:59:46','','204.jpg','','inherit','open','closed','','204-jpg','','','2018-08-05 20:59:46','2018-08-05 20:59:46','',0,'http://localhost/wordpress/wp-c