\"remove-header\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:13:20\"\n    },\n    \"lz-real-blog::header_image_data\": {\n        \"value\": \"remove-header\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:13:20\"\n    },\n    \"lz-real-blog::nav_menu_locations[primary]\": {\n        \"value\": 2,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:14:20\"\n    },\n    \"lz-real-blog::nav_menu_locations[footer]\": {\n        \"value\": 0,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:14:20\"\n    },\n    \"blogname\": {\n        \"value\": \"\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:15:20\"\n    },\n    \"blogdescription\": {\n        \"value\": \"\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-08-06 14:15:32\"\n    }\n}','','','trash','closed','closed','','613533de-50b6-4fce-8d80-a01bd2f514f4','','','2018-08-06 14:15:32','2018-08-06 14:15:32','',0,'http://localhost/wordpress/?p=120',0,'customize_changeset','',0),(122,1,'2018-08-06 14:23:14','2018-08-06 14:23:14','<h6>Pictures of Selected Personal Projects</h6>		\n			<h3>Dog Breed Classifier</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/Dog-breed-Identifier\"><img width=\"525\" height=\"191\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/dogbreed.png\" alt=\"\" /></a></figure>		\n			<h6>Find out the breed of your dog by uploading its picture was goal of this project. The application is built using Flask and Keras and uses Resnet50 model to make the predictions</h6>		\n			<h3>Get Latest Headlines</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/headlines\"><img width=\"525\" height=\"257\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/headlines_1.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/headlines\"><img width=\"525\" height=\"246\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/headlines_2.png\" alt=\"\" /></a></figure>		\n			<h6>A simple Flask and Python based web application that makes use of open weather API, open exchange rate API and RSS Feed from several news channels to pull latest data and present it in a simple way</h6>		\n			<h3>Waiter Call Application</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"279\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"277\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_dashboard.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"279\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_account.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"278\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_waiter.png\" alt=\"\" /></a></figure>		\n			<h6>Simple Waiter caller App that allows restaurant owners to use technology to know when their customers need a waiter. The restaurant owner places a small URL on each table which a customer makes a request on to call a waiter and request is logged on the dashboard that is visible to the restaurant owner</h6>		\n			<h2><h3 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Type Here...\" style=\"color: rgb(12, 12, 12); text-align: center;\">Highlight Problems Around You</h3></h2>		\n			<figure><a href=\"https://github.com/bilalmahmood1/Capture-Crime\"><img width=\"525\" height=\"250\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/crimemap-1.png\" alt=\"\" /></a></figure>		\n			<h2><br>\nThe goal of this website is to allow citizens to register their concerns and the relevant government bodies to take action. It is high time that the governments, especially of developing nations, rely on data to get its priorities straight and a platform for the public to raise their local problems!</h2>','Portfolio','','inherit','closed','closed','','63-revision-v1','','','2018-08-06 14:23:14','2018-08-06 14:23:14','',63,'http://localhost/wordpress/?p=122',0,'revision','',0),(123,1,'2018-08-06 14:24:58','2018-08-06 14:24:58','<h6>Pictures of Selected Personal Projects</h6>		\n			<h3>Dog Breed Classifier</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/Dog-breed-Identifier\"><img width=\"525\" height=\"191\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/dogbreed.png\" alt=\"\" /></a></figure>		\n			<h6>Find out the breed of your dog by uploading its picture was goal of this project. The application is built using Flask and Keras and uses Resnet50 model to make the predictions</h6>		\n			<h3>Get Latest Headlines</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/headlines\"><img width=\"525\" height=\"257\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/headlines_1.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/headlines\"><img width=\"525\" height=\"246\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/headlines_2.png\" alt=\"\" /></a></figure>		\n			<h6>A simple Flask and Python based web application that makes use of open weather API, open exchange rate API and RSS Feed from several news channels to pull latest data and present it in a simple way</h6>		\n			<h3>Waiter Call Application</h3>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"279\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"277\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_dashboard.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"279\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_account.png\" alt=\"\" /></a></figure>		\n			<figure><a href=\"https://github.com/bilalmahmood1/WaiterCaller\"><img width=\"525\" height=\"278\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/waiterCaller_waiter.png\" alt=\"\" /></a></figure>		\n			<h6>Simple Waiter caller App that allows restaurant owners to use technology to know when their customers need a waiter. The restaurant owner places a small URL on each table which a customer makes a request on to call a waiter and request is logged on the dashboard that is visible to the restaurant owner</h6>		\n			<h2><h3 data-elementor-setting-key=\"title\" data-pen-placeholder=\"Type Here...\" style=\"color: rgb(12, 12, 12); text-align: center;\">Highlight Problems Around You</h3></h2>		\n			<figure><a href=\"https://github.com/bilalmahmood1/Capture-Crime\"><img width=\"525\" height=\"250\" src=\"http://localhost/wordpress/wp-content/uploads/2018/08/crimemap-1.png\" alt=\"\" /></a></figure>		\n			<h2>The goal of this website is to allow citizens to register their concerns and the relevant government bodies to take action. It is high time that the governments, especially of developing nations, rely on data to get its priorities straight and a platform for the public to raise their local problems</h2>','Portfolio','','inherit','closed','closed','','63-revision-v1','','','2018-08-06 14:24:58','2018-08-06 14:24:58','',63,'http://localhost/wordpress/?p=123',0,'revision','',0);
